My week in Türkiye was honestly one of the best of my life, and I was completely blown away by the richness of the food and culture. Everything was so fresh and deliberate, it was honestly such a new way to look at what ingredients can do in their purest form. We tried our best to eat at local family run restaurants, and I think it really paid off! 

These were my top picks from our trip! 

@demeticihangir was a very cute restaurant overlooking Istanbul! A bit pricier and fancier, but I loved the mezze style of the food 

@altin.kepce was recommended by a local in Bergama, and they specialize in Koftesi which is the regional specialty. Super simple but impeccably done

@fishfishbalik was a seafood restaurant near kusadasi that I loved! I was adamant to have a whole grilled sea bass while I was on the coast and this delivered and more 

Hanimeli Gozleme was a really cute local restaurant run by a woman named Fatima who made everything from a tiny kitchen. You must order the Manti and the Gozleme 

@halketliekmek in Konya was sublime, and the baçik arasi & etliekmek were unreal. We were so sure we ordered too much, but we ended up polishing the whole thing off

@tasteoffmoms was a super lovely small restaurant run by a woman named Khadin, who turned her family home into a restaurant exclusively serving Gozleme. Bonus points as they’re all veggie! You could taste the expertise and care in every bite! 

@fatimaninsofrasi was another really nice local restaurant near Goreme, a place that is lowkey hard to find good food in! Definitely get the manti and juicy meatballs 

@borekci_huseyin_usta was our final hail mary to find borek that lived up to diego’s standards, and WOW! it blew us out of the water. Super crispy top, chewy middle, and excellently seasoned fillings. Plus the staff are super friendly and their lemonade is delicious (kind of tastes like Tang!). 10/10 

I hope you find all these spots helpful! We ate at a ton of places but these were my standouts. 

#lailaspantry #chef #turkiye #turkishfood

